import "./Components.css";
import Sidebar from "./Sidebar";
import { useEffect, useReducer, useState } from "react";
import { toast } from "react-hot-toast";
import { useNavigate } from "react-router-dom";
import reducer, { initialState } from "../helper/reducer";

function Homepage() {
  const [userData, setUserData] = useState([]);
  const [currentData, setCurrentData] = useState();
  const [userStory, setUserStory] = useState([]);
  const [state, dispatch] = useReducer(reducer, initialState)
  const route = useNavigate();

  function handleInputChange(e) {
    dispatch({
      type: 'changed_name',
      nextName: e.target.value
    });
  }

  useEffect(() => {
    const dataFromLs = JSON.parse(localStorage.getItem("userDataIn")) || [];
    setUserData(dataFromLs);
  }, []);

  useEffect(() => {
    var currentUser = JSON.parse(localStorage.getItem("CurrentUserIn"));
    if (currentUser) {
      var dataFromLs = JSON.parse(localStorage.getItem("userDataIn"));
      if (dataFromLs) {
        var array = [];
        for (var i = 0; i < dataFromLs.length; i++) {
          if (dataFromLs[i].stories) {
            array = array.concat(dataFromLs[i].stories);
          }
          // setUserStory(array);
        }
        setUserStory(array);
      }
      setCurrentData(currentUser.currentUserName);
    } else {
      toast.error("Login to your Profile");
    }
  }, []);

  useEffect(() => {
    var currentUser = JSON.parse(localStorage.getItem("CurrentUserIn"));
    if (currentUser) {
      var dataFromLs = JSON.parse(localStorage.getItem("userDataIn"));
      if (dataFromLs) {
        var array = [];
        for (var i = 0; i < dataFromLs.length; i++) {
          if (dataFromLs[i].posts) {
            array = array.concat(dataFromLs[i].posts);
          }
          // setUserData(array);
        }
        setUserData(random(array));
      }
      setCurrentData(currentUser.currentUserName);
    } else {
      toast.error("Login to your Profile");
    }
  }, []);

  function random(array) {
    let currentIndex = array.length;
    let randomIndex;

    while (currentIndex !== 0) {

      randomIndex = Math.floor(Math.random() * currentIndex);
      currentIndex--;

      [array[currentIndex], array[randomIndex]] = [array[randomIndex], array[currentIndex]];

    }
    return array;
  }

  return (
    <div id="homePage">
      <Sidebar />
      <div className="home-content">
        <div>
          <div>
            <img onClick={() => route('/addpost')} src="https://cdn.pixabay.com/photo/2018/11/13/22/01/instagram-3814084_1280.png" alt="1" />
          </div>
          <div id="story">
            {userStory.map((e, i) => (
              <div key={i}>
                <img src={e.storyImage} alt="story" />
              </div>
            ))}
          </div>
        </div>
        <div className="home-add-content">
          <div>
            {userData.map((e, i) => (
              <div id="home-post-display" key={i}>
                <h3>{e.username}</h3>
                <img src={e.image} alt="Post" /><br />
                <div>
                  <i class="fa-solid fa-heart"></i><i class="fa-solid fa-share-nodes"></i> <i class="fa-solid fa-comment"></i>
                </div>
                <p>{e.caption}</p>
                <div id="home-border"></div>
              </div>
            ))}
          </div>
        </div>
      </div>
      <div className="home-suggestions">
        <div className="home-suggestions-top">
          <div>
            <img src="data:image/jpeg;base64," alt="img" />
          </div>
          <div>
            <h5 onChange={handleInputChange}>{state.email}</h5>
            <p>Sneha Sachin Rajpurkar</p>
          </div>
          <div>Switch</div>
        </div>
        <div className="home-suggestions-mid">
          <div>
            <p>Suggestions for you</p>
            <p>See All</p>
          </div>
          <div className="home-profiles">
            <div>
              <img src="data:image/jpeg;base64," alt="1" />
            </div>
            <div>
              <h5>divyanshu22 07</h5>
              <p>Followed by bhagyashri_808 + 10 more</p>
            </div>
            <div>Follow</div>
          </div>
          <div className="home-profiles">
            <div>
              <img src="data:image/jpeg;base64," alt="1" />
            </div>
            <div>
              <h5>vinod.j.kadam</h5>
              <p>Followed by singh_prathmesh85+ 1 more</p>
            </div>
            <div>Follow</div>
          </div>
          <div className="home-profiles">
            <div>
              <img src="data:image/jpeg;base64," alt="1" />
            </div>
            <div>
              <h5>anita_singh1210</h5>
              <p>Followed by singh_prathmesh85</p>
            </div>
            <div>Follow</div>
          </div>
          <div className="home-profiles">
            <div>
              <img src="data:image/jpeg;base64," alt="1" />
            </div>
            <div>
              <h5>nitinshinde7712</h5>
              <p>Followed by manishasutar626</p>
            </div>
            <div>Follow</div>
          </div>
        </div>
        <div className="home-suggestions-bot">
          <div>
            <p>About</p>
            <p>Help</p>
            <p>Press</p>
            <p>API</p>
            <p>Jobs</p>
            <p>Privacy</p>
            <p>Terms</p>
            <p>Locations</p>
            <p>Language</p>
            <p>English</p>
            <p>Meta</p>
            <p>Verified</p>
          </div>
          <div>
            © 2023 INSTAGRAM FROM META
          </div>
        </div>
      </div>
    </div>
  );
}

export default Homepage;
